}

@override
class CountryList extends StatelessWidget{
  Widget rendCountriesStats(BuildContext context, AsyncSnapshot<List<Country>> snapshot) {
    if(snapshot.hasError){
      print(snapshot.error.toString());
      return Text('Error!');
    }else if(snapshot.hasData){
      return Container(
        color: Color.fromRGBO(253, 245, 243, 0.3),
        padding: EdgeInsets.only(left: 15, top: 15, right: 15, bottom: 0),
        margin:  EdgeInsets.only(left: 8, top: 8, right: 8, bottom: 0),
        child: ListView.separated(
          itemCount: snapshot.data.length,
          separatorBuilder: (context, i){
            return Divider();//Se puede ponder cualquier cosa
          },
          itemBuilder: (context, i){
            final Country post = snapshot.data[i];
            return ListTile(
              leading: Container(
                decoration: BoxDecoration(
                  shape: BoxShape.circle
                ),
                child: Flags.getMiniFlag(post.code, 30, 30),
              ),
              trailing: Icon(Icons.arrow_forward),
              title: Text(post.title),
              onTap: (){
                return Navigator.push(
                  context,
                  MaterialPageRoute(builder: (context) => CountryDetails(post)),
                );
              },
            );
          },
        )
      );
    }else{
      return Center(
          child: Container(
            height: 20,
            width: 20,
            child: CircularProgressIndicator(),
          )
      );
    }
  }
  //child: Flags.getMiniFlag(post.code, null, null)
  @override
  Widget build(BuildContext context) {
    // TODO: implement build
    return null;
  }
}

